import React from "react";
import { Link } from "react-router-dom";

function SubjectList() {
    const styles = {
        container: {
          maxWidth: "400px",
          margin: "50px auto",
          padding: "20px",
          backgroundColor: "#f9f9f9",
          borderRadius: "8px",
          boxShadow: "0 2px 5px rgba(0, 0, 0, 0.1)",
          textAlign: "center",
        },
        heading: {
          fontFamily: "'Poppins', sans-serif",
          fontSize: "1.8rem",
          marginBottom: "20px",
          color: "#6b4f4f",
        },
        input: {
          width: "100%",
          padding: "10px",
          margin: "10px 0",
          borderRadius: "5px",
          border: "1px solid #ddd",
          fontSize: "1rem",
        },
        button: {
          width: "100%",
          padding: "10px",
          backgroundColor: "#6b4f4f",
          color: "#fff",
          border: "none",
          borderRadius: "5px",
          cursor: "pointer",
          fontSize: "1rem",
          margin: "10px 0",
          transition: "background-color 0.3s ease",
        },
        createAccount: {
          marginTop: "20px",
          fontSize: "0.9rem",
          color: "#6b4f4f",
          cursor: "pointer",
          textDecoration: "underline",
        },
      };
    const subjects = [
        "Business Process Management",
        "Engineering Math",
        "Communication II",
        "Open Source SW",
        "Data Structure",
        "Computer System"
    ];

  return (
    <div>
      <h1>과목 목록</h1>
      <ul>
        {subjects.map((subject, index) => (
          <li key={index}>
            <Link to={`/board/${subject.toLowerCase().replace(/ /g, "-")}`}>
              {subject}
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default SubjectList;
